import React, { Component } from 'react'

export class LinkedInLogin extends Component {
  render() {
    return (
      <div>
        <p>Hello from LinkedIn Login</p>
        <a href="https://www.linkedin.com/oauth/v2/authorization?response_type=code&client_id=123456789&redirect_uri=https%3A%2F%2Fwww.example.com%2Fauth%2Flinkedin&state=987654321&scope=r_basicprofile"></a>
      </div>
    )
  }
}

export default LinkedInLogin
